import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Register from '../components/register';
import LogIn from '../components/login';
import TopicList from '../components/topics';
import StartNewTopic from '../components/start_new_topic';
import Chat from '../components/chat';

const Content = ({setUser, user, logIn, history, setTopics}) => {
    return (
        <main className="main">
            <Switch>
                <Route exact path='/' component={(props) => <> <Register setUser={setUser} {...props}/> <LogIn setUser={setUser} {...props} /> <TopicList logIn={logIn} history={history} /> </>} />
                <Route path='/topic-list' component={(props) => <> <TopicList logIn={logIn} history={history} settopics={setTopics} {...props}/> <StartNewTopic logIn={logIn} /> </>} />

                {/* <Route path='/topic-list/${topic_id}' component={() => <Chat history={history} user_id, username, message, timestamp}} /> */}
                {/*Chat path='topic-list/topic_id'*/}
            </Switch>
        </main>
    )
}

export default Content;
